    {
      "id": "Ireland",
      "type": "Country"
    },
    {
      "id": "CaF-01 \u2013 The ES instructed the work party to access the work site without the authorisation of the PICOP; a violation of the requirements set out in Section T, Part Three, of the I\u00c9 Rule Book. The ES erroneously thought that the last train had passed through the worksite (paragraph 195 - 197)",
      "type": "ContributingFactor"
    },
    {
      "id": "CaF-02 \u2013 The work detail entered the work site, as they accepted the authority of the I\u00c9-IM ES\u2019s position (both I\u00c9-IM and contracted staff), and assumed they were safe to enter the T3 Possession. This level of acceptance indicates an element of \u201cauthority gradient\u201d, which is further emphasised when the PIC (who took over the roles of the ES), rejected the GOs requests to cease work after the accident; and they re-commenced working (paragraph 213)",
      "type": "ContributingFactor"
    },
    {
      "id": "CoF-01 \u2013 The Safety Tours, as set out in CCE-SMS-008, were ineffective at capturing rule breaks prior to possessions being granted, such as work parties accessing the railway before the possession being granted and equipment left near the railway line overnight (paragraph 222)",
      "type": "ContributingFactor"
    },
    {
      "id": "SF-01 \u2013 The Safety Tour Form differs from the checks required to be completed in the Guidelines for Safe Possession Management (see Figure 11), the guidance part of the Safety Tour Form asks if the movements are planned and safely controlled, however, this information does not have to be recorded",
      "type": "SystemicFactor"
    },
    {
      "id": "Commission for Railway Regulation (CRR)",
      "type": "RegulatoryBody"
